export default function App() {
  return (
    <div className="App">
      <div>
        <img alt="react logo" src={logo} />
      </div>

      <div>
        <h2>Chat app ex whatsap</h2>
        <h2>E-commerce app</h2>
        <h2>Blog app</h2>
